          "codigo": 2754,
          "titulo": "A Carnaubeira",
          "subtitulo": "",
          "informacao": "Da memória bibliográfica sobre a carnaubeira, consta este folheto escrito em 1932, em Caraúbas –\nRio Grande do Norte, quando milhares de pés de carnaúba, localizados em pontos mais altos e\nmais afastados das margens dos rios morreram em decorrência da seca. “A carnaubeira é uma das\nmais ricas dádivas que a natureza presenteou o Nordeste”.",
